var iconTreeTarget = '';

// 군대부호 속성창 - 아이콘 부호코드 팝업 js
initIconPopup();

function initIconPopup() {
    initIconTree('d2map_msSIDCTree');

    document.querySelector('#d2map_ms-style-button-icon').addEventListener('click', function () {
        var cd = window.graphic.getSelectObjectList()[0]._prop.msOriginKey;
        openIconPopup(cd);
    });

    document.querySelector('#d2map_ms-sidc-controller-btns-property').addEventListener('click', function () {
        var sidc = window.graphic.getSelectObjectList()[0]._prop.options.SIDC;
        window.MilSymbol.getMilSymbolPropertiesObject().setMSStyle(sidc, true);
    });
}

// 트리를 생성한다.
function initIconTree(target) {
    iconTreeTarget = target;
    var tree = new ICOPS.TreeView(target, []);
    tree.on('select', onIconPropertyClick)
}

