// 트리 - 노드 클릭이벤트
function onIconPropertyClick(e) {
    var cd = e.data.cd;
    if (cd == 'none') {
        cd = '';
        document.querySelector('#d2map_ms-sidc-preview').innerHTML = '';
        document.querySelector('#d2map_ms-sidc-name-code').textContent = '';
    } else {
        var mineArr = ['G*--------', 'G*M*------', 'G*M*O-----', 'G*M*OM----', 'G*M*OMU---', 'G*M*OMT---', 'G*M*OMD---', 'G*M*OME---', 'G*M*OMP---', 'G*M*OMW---', 'G*M*OMC---', 'G*M*OMA---', 'G*M*OMB---', 'G*M*OMF---',]
        if (mineArr.indexOf(cd) > -1)
            cd = cd + '****X';
        else {
            if (document.querySelector('#d2map_ms-style-nonpoint-info-A').value.substr(10, 5) == '')
                cd = cd + '*****';
            else
                cd = cd + document.querySelector('#d2map_ms-style-nonpoint-info-A').value.substr(10, 5);
        }
    }

    if (cd != undefined)
        drawMSSimbol(cd)

    var enter = new Event('change', { "bubbles": true });
    document.querySelector('#d2map_ms-sidc-name-code').textContent = cd ? cd : '';
    document.querySelector('#d2map_ms-style-nonpoint-info-A').value = cd ? cd : '';
    document.querySelector('#d2map_ms-style-nonpoint-info-A').dispatchEvent(enter);

    // 아이콘 미리보기를 그린다.
    function drawMSSimbol(cd) {
        // 군대부호 객체 선언
        var sym = new ICOPS.D2MS.ms.Symbol('');
        var aff = document.querySelector('#d2map_ms-sidc-controller-affiliation').value;
        cd = cd.substring(0, 1) + aff + cd.substring(2);

        // 군대부호 option 설정
        var options = {
            SIDC: cd,
            size: 10,
            strokeWidth: 4, //외곽선 두께
            infoColor: '#000000',
            infoFields: undefined
        };

        // 작전활동부호 중 일부 수식정보 기본 입력
        var mineCodeArr = ['GFG*PN----****X', 'GHG*PN----****X', 'GNG*PN----****X', 'GUG*PN----****X', 'GFM*OFS---****X', 'GHM*OFS---****X', 'GNM*OFS---****X', 'GUM*OFS---****X'];

        var windCodeArr = ['WFS-WP----P----', 'WHS-WP----P----', 'WNS-WP----P----', 'WUS-WP----P----'];

        // 지뢰관련 작전활동부호 일때 기본 아이콘부호코드 입력
        if (mineCodeArr.indexOf(cd) > -1) {
            options.addSymbol = 'G*M*OMU---****X';
        }

        // 바람장 표시
        if (windCodeArr.indexOf(cd) > -1) {
            options.addSymbol = 'WAS-CCCSCSP----';
        }

        sym.setOptions(options);
        var explorerImg = document.querySelector('#d2map_ms-sidc-preview');

        //IE11 체크
        let imgSrc = 'data:image/svg+xml;charset=utf-8,' + encodeURIComponent(sym.asSVG());

        var img = document.createElement('img');
        img.src = imgSrc;

        // 유효한 이미지일 때만 그리기
        explorerImg.innerHTML = '';
        if (window.MilSymbol.getMilSymbolType(cd) == 0 || cd.length != 15)
            cd = undefined;

        explorerImg.append(img);
    }
}

// 아이콘 부호코드 팝업을 연다.
function openIconPopup(msCode) {
    var tree = window.ICOPS.TreeView.getTreeObject(iconTreeTarget);
    tree.options.data = getTreeNode(msCode);
    tree.reload();

    document.querySelector('#d2map_ms_prop_container_sidc').style.display = 'block'
}
